} from "react";
import {
  motion,
  useScroll,
  useSpring,
  useTransform
} from "framer-motion"

/* Images */
import img_test from '../../imgs/components/logo_school.png';

/* Styles */
import './notFound.scss'

/* Testing Paralax Efect with react Framer Motion */
function useParallax(value, distance) {
  return useTransform(value, [0, 1], [-distance, distance]);
}

function Image({ id }) {
  const ref = useRef(null);
  const { scrollYProgress } = useScroll({ target: ref });
  const y = useParallax(scrollYProgress, 10);

  return (
    <section className="paralax">
      <div ref={ref}>
        <img src={img_test} alt="" />
